-- =============================================
-- author:		<mercuryulla m>
-- create date: <10/28/2010, 11:20>
-- description:	<add to categorysource>
-- =============================================
Create procedure [dbo].[api_createcategorysource]
	@idx int =null output,
	@categorysource_idx int,
	@name nvarchar(1200),
	@shortdesc nvarchar(max),
	@longdesc nvarchar(max),
	@businessbenefits nvarchar(max) =null,
	@websiteurl nvarchar(1200),
	@openinnewwindow bit,
	@author nvarchar(200),
	@active bit,
	@consumable bit,
	@createdby nvarchar(100) = null
	
As
Begin
	Set nocount on;

	Insert into dh_categorysource
	(
		Categoryidx,
		Name,
		Shortdesc,
		Longdesc,
		Businessbenefits,
		Websiteurl,
		Openinnewwindow,
		Author,
		Active,
		Consumable,
		Createdby
	)
	Values
	(
		@categorysource_idx,
		@name ,
		@shortdesc,
		@longdesc,
		@businessbenefits,
		@websiteurl,
		@openinnewwindow,
		@author,
		@active,
		@consumable,
		@createdby
	)
	
	
	
	Select @idx =scope_identity()

	
End

Go
