-- =============================================
Create procedure [dbo].[api_createfeedback]
	@idx int =null output,
	@feedbackcategoryidx int,
	@comments nvarchar(max),
	@status int,
	@user_firstname nvarchar(128) = null,
	@user_lastname nvarchar(128) = null,
	@user_email nvarchar(256) = null,
	@user_idx int = null,
	@createdby nvarchar(256)= null
As
Begin
	Set nocount on;
	Insert into dh_feedback
           (
			 Feedbackcategoryidx
            ,comments
            ,status
            ,user_firstname
            ,user_lastname
            ,user_email
            ,user_idx
            ,createdby
           )
     Values
           (
			 @feedbackcategoryidx 
			,@comments 
			,@status
			,@user_firstname 
			,@user_lastname 
			,@user_email
			,@user_idx,
			 @createdby 
           )

	Select @idx =scope_identity()

End

