Create proc [dbo].[api_createfeedbackresponses]
	@idx int =null output,
	@feedback_idx int,
	@user_idx int,
	@comments nvarchar(max),
	@createdby nvarchar(256)= null
As
Begin

Set nocount on;
	Insert into dh_feedback_responses
           (
			 Feedback_idx
			,user_idx 
            ,comments
            ,createdby
           )
     Values
           (
			 @feedback_idx
			,@user_idx 
			,@comments 
			,@createdby 
           )
	Update dh_feedback set status=1 where idx=@feedback_idx;
	Select @idx =scope_identity()
End






