-- =============================================
-- author:		<mercuryulla m>
-- create date: <11/08/2010 , 10:06gorysource>
-- =============================================
Create procedure [dbo].[api_createuserrating]
	@score decimal(18, 2),
	@user_idx int,
	@categorysource_idx int,
	@outscore decimal(18,2)=null output,
	@outratingcount int = null output

As
Begin
	--delete the previous rating added by user for given source
	Declare @ratingcount int,@avgrating decimal(18,6)
	
	Delete from dh_user_rating where user_idx = @user_idx
	And categorysource_idx =@categorysource_idx
	
	Insert into dh_user_rating(user_idx,categorysource_idx,rating)
	Values(@user_idx,@categorysource_idx,@score)
		
	Select @ratingcount= count(*) from dh_user_rating where categorysource_idx =@categorysource_idx
	
	Select  @avgrating  = sum(rating)/ @ratingcount from dh_user_rating where categorysource_idx =@categorysource_idx
	
	Update dh_categorysource 
	Set avgrating =convert(decimal(18,2),@avgrating),ratingcount=@ratingcount
	Where idx =@categorysource_idx
	
	Select @outscore=convert(decimal(18,2),@avgrating),@outratingcount=@ratingcount
	
	
	
End

