-- =============================================
-- author:		<mercuryulla m>
-- create date: <12/01/2010 18:43:32 >
-- description:	<get all tags>
-- =============================================
Create procedure [dbo].[api_getalltags]
	
As
	Begin
		
Select dht.Idx , dht.Name , dht.Createdby , dht.Createdon , dht.Lastupdatedby,dht.Lastupdatedon , 
		Case when count(dhct.Tag_idx) > 0 then 1 else 0 end isassociated
		From dh_tags dht left outer join
		(
				Select 	distinct dhct.Tag_idx from 	dbo.Dh_categorysource_tags dhct
				Inner join dbo.Dh_categorysource dcs
				On dhct.Categorysource_idx=dcs.Idx and dcs.Active =1

		) dhct
		On dht.Idx = dhct.Tag_idx 
		Group by dht.Idx , dht.Name , dht.Createdby , dht.Createdon , dht.Lastupdatedby,dht.Lastupdatedon
		Order by dht.Name asc
	End
	
	
	


