/****** object:  storedprocedure [dbo].[dh_getspreadsbyperiod_sks]    script date: 12/31/2020 9:40:11 am ******/
Set ansi_nulls on
Go
Set quoted_identifier on
Go
--exec dh_getspreadsbyperiod_sks 12, 2010, 3, 1, 2
Create proc [dbo].[dh_getspreadsbyperiod_sks]
	@budgetnoofperiods int, @intyear int, @intbgtnoofyears int, 
	@fystartcalandermonth int = 1, @cyfymonthstart int = 1
As
Begin
	--waitfor delay '00:0:10';
	Declare @per_start_year int, @per_start_month int, @per_end_year int, @per_end_month int
	Select	
		@per_start_year = @intyear, 
		@per_start_month = @fystartcalandermonth, 
		@per_end_year = @intyear + @intbgtnoofyears - 1,
		@per_end_month = @fystartcalandermonth - 1
		
	If @fystartcalandermonth > 1
	Begin
		Select @per_start_year = @intyear - 1
	End

	If @fystartcalandermonth = 12
	Begin
		Select @per_end_month = 1
	End
	Else if @fystartcalandermonth = 1 
	Begin
		Select @per_end_month = @budgetnoofperiods
	End


	Select
		Spread_id, spread_code, fiscal_year, fiscal_month, amount
	Into #temp_dh_spread_data
	From
	(
		Select 
			Dsm.Idx spread_id, dsm.Code spread_code, 
			Ysrc.[temp_year] fiscal_year, dsf.Month fiscal_month, 
			Isnull(dsf.Amount, 0) amount
		From
			Tb_spread_master dsm, tb_spread_num_period_map dsnpm, tb_spread_fact dsf, 
			(select (idx + @intyear - 1) [temp_year] from tb_spread_master where idx between 1 and @intbgtnoofyears) ysrc
		Where
			Dsm.Idx = dsnpm.Spread_id and
			Dsm.Idx = dsf.Spread_id and
			Dsnpm.Spread_id = dsf.Spread_id and
			Dsnpm.Num_periods = dsf.Num_periods and
			Dsf.Month between dsnpm.Period_start and dsnpm.Period_end and
			Dsnpm.Num_periods = @budgetnoofperiods and
			Dsnpm.Spread_basis_id  = 1
		Union
		Select 
			Dsm.Idx spread_id, dsm.Code spread_code, 
			Case when @per_start_month > 1 and dsf.Month >= @per_start_month  then dsf.Year+1 else dsf.Year end fiscal_year, 
			Case when @per_start_month > 1 then case when dsf.Month >= @per_start_month then dsf.Month - @per_start_month + 1  else @budgetnoofperiods + dsf.Month - @per_start_month + 1 end else dsf.Month end fiscal_month, 
			Isnull(dsf.Amount, 0) amount
		From
			Tb_spread_master dsm, tb_spread_num_period_map dsnpm, tb_spread_fact dsf
		Where
			Dsm.Idx = dsnpm.Spread_id and
			Dsm.Idx = dsf.Spread_id and
			Dsnpm.Spread_id = dsf.Spread_id and
			Dsnpm.Num_periods = @budgetnoofperiods and
			Dsnpm.Num_periods = dsf.Num_periods and
			Dsf.Year between @per_start_year and @per_end_year and
			(
				(dsf.Year = @per_start_year and dsf.Month >= @per_start_month) or
				(dsf.Year = @per_end_year and dsf.Month <= @per_end_month) or
				(dsf.Year between @per_start_year+1 and @per_end_year-1)
			) and 
			Dsnpm.Spread_basis_id  = 2 and
			Dsf.Month <= dsf.Num_periods and dsf.Cy_fy_month_start = @cyfymonthstart
	) src
	
	Declare @str_prd nvarchar(max),@sqlqry nvarchar(max)
	
	Select @str_prd = coalesce(@str_prd + ',', '') + '[' + convert(nvarchar,fiscal_year) + '-' + convert(nvarchar,fiscal_month) + ']' 
	From #temp_dh_spread_data
	Group by fiscal_year, fiscal_month
	 
	--print @str_prd
	Select  @sqlqry = '	select	
							Spread_id, spread_code, ' + @str_prd + '
						From
							(select spread_id, spread_code, convert(nvarchar, fiscal_year)+''-''+ convert(nvarchar, fiscal_month) as fiscal_month, amount 
								From  #temp_dh_spread_data 
							) as src
							Pivot ( sum( amount) for fiscal_month in ( '+ @str_prd +')) as pvt
						Order by spread_code'
	Exec ( @sqlqry)
	
	 
			
End
Go
