Create procedure [dbo].[get_keyperformanceindicator_stratagy_customer_items_tmp]
 @category_key nvarchar(100)='%'
,@stratagy nvarchar(100)

,@tmp_cust_base_feed_root_url nvarchar(max)='' ---temporery base feed root url used for accessing feed data of each individual keyperformanceindicator

As 
Begin 
	
	If len(@tmp_cust_base_feed_root_url) >0
	Begin
		If  right(@tmp_cust_base_feed_root_url,1)='/'
			Select 	@tmp_cust_base_feed_root_url=substring(@tmp_cust_base_feed_root_url,1,len(@tmp_cust_base_feed_root_url)-1) 
			
	End
	
	Declare @tmp_dsh_customer_data table
	(
		 Id int identity
		 ,dsh_cat_source_idx int
		,[file_name] nvarchar(max)
		,file_url  nvarchar(max)
		,xmlheader nvarchar(max)
		,data nvarchar(max)
		,xmlfooter nvarchar(max)
	 )

	Declare @beginidx int
	Declare @endidx int
	Declare @cntr int
	Select @beginidx=isnull(min(idx),0) from dh.Dbo.Dh_categorysource where name like @category_key
	Select @endidx=isnull(max(idx),0) from dh.Dbo.Dh_categorysource  where name like @category_key
	Select @cntr=@beginidx
	Declare @customer_web_rss_feed_url nvarchar(max)
	Declare @website nvarchar(max)
	Declare @file_name nvarchar(max)
	Declare @name nvarchar(100)
	Declare @shortdesc nvarchar(max)
	Declare @lastupdateddate nvarchar(50)
	Declare @header nvarchar(max) 
	Declare @footer nvarchar(max) 

	Select @footer=
	  '</channel>
	</rss>'

	While @cntr<=@endidx
	Begin
		

		Select 
		 @website=websiteurl 
		,@customer_web_rss_feed_url= @tmp_cust_base_feed_root_url +'/' +dbo.Common_resetfilenamestring(name) +'.Xml'
		,@file_name=dbo.Common_resetfilenamestring(name) +'.Xml'
		,@name=dbo.Common_resetfilenamestring(name)
		,@shortdesc=shortdesc
		,@lastupdateddate=convert(nvarchar(100),lastupdatedon) 
		 From dh.Dbo.Dh_categorysource where idx=@cntr and   name like @category_key

		

	Set @header=
	(
		Select  '<?Xml version="1.0" encoding="Us-ascii"?>


		<rss version="2.0" xmlns:' +@name +'="' + @name +'">
		<channel>
			<title>feed for ' + @name +'</title>
			<link>' +@website +'</link>
			<description>' + @shortdesc +'</description>
			<language>en-us</language>
			<lastbuilddate>' + convert(nvarchar(50), @lastupdateddate) +'</lastbuilddate>'
	        
	)

		
		Insert into @tmp_dsh_customer_data 
		Select  top 38 @cntr ,@file_name,@customer_web_rss_feed_url,@header, data='<item>' +
		'<title>' + 	 replace(  replace(replace( replace( replace(title,'/>','/>'),'>','>'),'<','<'),'"','   '),'""','&quot;') + '</title>
		<link>' +@customer_web_rss_feed_url +'</link>' +
		'<description>'+replace( replace(replace( replace(replace(description,'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + ' </description>' 
		+'<language>en-us</language>
		<guid  ispermalink ="True">' +replace(  replace(replace( replace( replace(permalink,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') +'</guid>
		<pubdate>' +convert(nvarchar(100),getutcdate())  +'</pubdate>
		<' +@name +':content keyperformanceindicator_code="' + 
		Replace(  replace(replace( replace( replace(id,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')
		+   '" '+ @stratagy + '= "' +replace(  replace(replace( replace( replace(strategy,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')
		+  '" frequency= "' + 
		Replace(  replace(replace( replace( 
		Replace([measurement frequency],'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') 
		+ '" frequency_type="' 
		+ replace(  replace(replace( replace( 
		Replace(direction,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;') +'" description=""  number_format= "' + replace(  replace(replace( replace( replace([unit type],'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')+ '" formula= "' 
		+ replace(  replace(replace( replace( replace(formula,'/>','/>'),'>','>'),'<','<'),'"','  '),'""','&quot;')   + '"
		  Title="' + 	 replace(  replace(replace( replace( replace(title,'/>','/>'),'>','>'),'<','<'),'"','   '),'""','&quot;') + '">
		<![cdata[' +replace( replace(replace( replace(replace(description,'&','&amp;'),'<','&lt;'),'>','&gt;'),'"','&quot;'),'''','&apos;') + ']]>
		 </'+@name +':content>
		</item>' ,@footer
		 From [dbo].[keyperformanceindicatorlib_sample_feed_hrratios] feed   
		  
		  Select @cntr=@cntr+1
	End

Select  * from @tmp_dsh_customer_data order by dsh_cat_source_idx
End
